import styled from "styled-components";

export const Transaction = styled.div`
  .contain {
    background-color: black;
    color: white;
    width: 50%;
    padding: 0.5em;
  }
  .contain .list {
    list-style: none;
  }
  .contain .list li {
    display: block;
  }
`;
